import '../App.css';
import './Navbar.css';

const Navbar = (props) => {
    const navigationLinks = document.querySelectorAll('.App-navbar-link');
    navigationLinks.click = (clickedLink) => {
        document.querySelectorAll('active').className.replace('active', '');
        clickedLink.className += ' active';
    }

    return (
        <nav className="App-navbar">
            <div className="App-navbar-container flex">
                <a href="/" className="App-logo"><i class="fab fa-sith"></i>UniteTheWorld</a>
                <ul className="App-navbar-menu flex">
                    <li className="App-navbar-item flex">
                        <a href="/about" className="App-navbar-link">About</a>
                    </li>
                    <li className="App-navbar-item flex">
                        <a href="/donate" className="App-navbar-link">Donate</a>
                    </li>
                    <li className="App-navbar-item flex">
                        <a href="/contact" className="App-navbar-link">Contact</a>
                    </li>
                    <li className="App-navbar-item flex">
                        <a href="/account" className="App-navbar-link">Account</a>
                    </li>
                </ul>
            </div>
        </nav>
    );
};

export default Navbar;
